import axios from 'axios'
import {serverUrl} from '../url'

export async function getUniversityFunction (param){
    return new Promise(async (resolve)=>{
        const url = `${serverUrl}Hipo/university-domains-list/master/world_universities_and_domains.json`;

        axios.get(url).then((res)=>{
            resolve(res)
        })
        .catch((err)=>{
            const error = err.response && err.response.data && err.response.data.message && `Error : ${err.response.data.message.toString().toUpperCase()}`
            param.error = error;
            resolve(param);
        })
    })
}

export async function getUniversityDetailFunction (param){
    return new Promise(async (resolve)=>{
        const url = `${serverUrl}Hipo/university-domains-list/master/world_universities_and_domains.json`;

        axios.get(url).then((res)=>{
            const data = res.data || [];

            console.log(data)

            resolve(data.filters((function (university) {
                return university.domain && university.domain[0] && university.domain[0].toLowerCase().includes(param.domain.toLowerCase())
            })));
        })
        .catch((err)=>{
            const error = err.response && err.response.data && err.response.data.message && `Error : ${err.response.data.message.toString().toUpperCase()}`
            param.error = error;
            resolve(param);
        })
    })
}
